import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { getSuratTugasAction } from "../../store/action/perjadinAction";

const CekRKA = () => {
  const dispatch = useDispatch();
  const { perjadin } = useSelector((state) => state.perjadinReducer);
  console.log(perjadin);
  useEffect(() => {
    dispatch(getSuratTugasAction());
  }, [dispatch]);
  return (
    <div className="p-5 bg-white mt-2">
      {perjadin.map((list, index) => (
        <div key={index}>
          <p>{list.kode_rka}</p>
        </div>
      ))}
    </div>
  );
};

export default CekRKA;
